PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?wikidata WHERE {
  <https://dblp.org/pid/o/AJeffersonOffutt> dblp:wikidata ?wikidata
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?venue ?venueLabel WHERE {
  <https://dblp.org/rec/journals/jlp/ShieberSP95> dblp:publishedInStream ?venue .
  OPTIONAL {
    ?venue rdfs:label ?venueLabel
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?venue ?venueLabel WHERE {
  VALUES ?author {
    <https://dblp.org/pid/19/2932-1> <https://dblp.org/pid/55/2484-1> <https://dblp.org/pid/40/4160> <https://dblp.org/pid/236/3060> <https://dblp.org/pid/40/4731>
  }
  ?other_pub dblp:authoredBy ?author .
  FILTER ( ?other_pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> ) ?other_pub dblp:publishedInStream ?venue .
  OPTIONAL {
    ?venue rdfs:label ?venueLabel
  }
}
ORDER BY ?venue

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?title WHERE {
  ?paper dblp:authoredBy <https://dblp.org/pid/63/10539> .
  OPTIONAL {
    ?paper rdfs:label ?title
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?title WHERE {
  ?paper dblp:authoredBy <https://dblp.org/pid/64/490> .
  ?paper dblp:publishedInStream ?stream .
  OPTIONAL {
    ?paper dblp:title ?title
  }
  FILTER ( ?stream = <https://dblp.org/streams/journals/corr> || ( ?stream = <https://dblp.org/streams/conf/vtc> && EXISTS {
    ?paper dblp:listedOnTocPage ?toc .
    FILTER regex( str( ?toc ) , "vtc[0-9]+s$" , "i" )
  }
  ) )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( ?pub ) AS ?count ) WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/21/4802> .
}

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
