PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?pub ?coauthor ?coauthorLabel ?affiliation WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/286/6829> ; dblp:yearOfPublication ?year ; dblp:authoredBy ?coauthor .
  FILTER ( ?year >= 2022 ) FILTER ( ?coauthor != <https://dblp.org/pid/286/6829> ) OPTIONAL {
    ?coauthor rdfs:label ?coauthorLabel
  }
  OPTIONAL {
    ?coauthor dblp:affiliation ?affiliation
  }
}

