PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?title WHERE {
  ?pub dblp:title ?title .
  ?pub dblp:publishedIn ?venue .
  OPTIONAL {
    ?pub dblp:yearOfPublication ?yearPub
  }
  OPTIONAL {
    ?pub dblp:yearOfEvent ?yearEvent
  }
  BIND( COALESCE ( ?yearPub , ?yearEvent ) AS ?year ) FILTER ( ?year = 2003 ) FILTER ( CONTAINS( LCASE( ?title ) , "overlay multicast" ) ) FILTER ( CONTAINS( LCASE( STR( ?venue ) ) , "hipc" ) || CONTAINS( LCASE( STR( ?venue ) ) , "high performance computing" ) )
